import React, { Component } from 'react'
import MainSheet from './index.module.css'

export default class UploadTest extends Component {
    render() {
        return (
            <div className={MainSheet.pageContainer}>
                <div className={MainSheet.fileUpload}>
                    <input  type="file" />
                </div>

            </div>
        )
    }
}
